  this.uploadfiles = function (S, T) {
    for (var R = 0; R < S.length; R++) {
      var Q = S[R];
      var M = Q.name;
      var O = Q.type;
      var N = Q.size;
      if (O.match(/image.*/) && T == "infodiv") {
        z.readlocalximage(Q, M, N);
      } else {
        if (
          O.match(/image.*/) &&
          T != "xml" &&
          !(
            M.substr(-3) == "tif" ||
            M.substr(-3) == "TIF" ||
            M.substr(-4) == "tiff" ||
            M.substr(-4) == "TIFF"
          )
        ) {
          z.readlocalimage(Q, M, N);
        } else {
          if (
            M.substr(-3) == "fit" ||
            M.substr(-3) == "FIT" ||
            M.substr(-3) == "tif" ||
            M.substr(-3) == "TIF" ||
            M.substr(-4) == "tiff" ||
            M.substr(-4) == "TIFF"
          ) {
            console.log("Loading BIN file");
            z.readlocalbinfile(Q, T);
          } else {
            z.readlocaltextfile(Q, T);
          }
        }
      }
    }
  };
