  this.makeppt = function (M, Q, T) {
    z = mapviewer;
    if (T) {
      outname = M;
    } else {
      outname = "xcviewer_overall";
    }
    z.printgraph = 1;
    z.printwidth = 940;
    z.printheight = 210;
    z.settings.showInfoBelow = "";
    z.redraw();
    z.settings.showInfoBelow = "CourseInfo";
    z.redraw();
    filename = "elevation.png";
    $("#selectgraph-1").val("4");
    $("#selectgraph-2").val("0");
    mapviewer.plotgraphs();
    z.saveimage(1, filename);
    z.printgraph = 1;
    z.printwidth = 940;
    z.printheight = 490;
    z.settings.showInfoBelow = "";
    z.redraw();
    z.settings.showInfoBelow = "CourseInfo";
    z.redraw();
    names = new Array();
    for (var S = 0; S < z.routes.length; S++) {
      name = z.routes[S].runnername;
      tmp = name.split(" - ");
      fname = tmp[0];
      ok = 0;
      for (var R = 0; R < names.length; R++) {
        if (names[R] == fname) {
          ok = 1;
        }
      }
      if (!ok) {
        names.push(fname);
      }
    }
    var N = new Array();
    for (var R = 0; R < names.length; R++) {
      name = names[R];
      for (var S = 0; S < z.routes.length; S++) {
        tname = z.routes[S].runnername;
        tmp = tname.split(" - ");
        fname = tmp[0];
        if (fname == name) {
          z.routes[S].show = 1;
        } else {
          z.routes[S].show = 0;
        }
      }
      if (!T || name == M) {
        filename = name + "_time.png";
        $("#selectgraph-1").val("1");
        mapviewer.plotgraphs();
        z.saveimage(1, filename);
        N.push(filename);
        filename = name + "_pulse.png";
        $("#selectgraph-1").val("5");
        mapviewer.plotgraphs();
        z.saveimage(1, filename);
        N.push(filename);
      }
    }
    tname = M + " - 1";
    tmp = tname.split(" - ");
    name1 = tmp[0];
    for (var R = 0; R < names.length; R++) {
      for (var O = 1; O <= Q; O++) {
        name = names[R];
        for (var S = 0; S < z.routes.length; S++) {
          tname = z.routes[S].runnername;
          tmp = tname.split(" - ");
          fname = tmp[0];
          lap = tmp[1];
          if ((fname == name || fname == name1) && lap == O) {
            z.routes[S].show = 1;
          } else {
            z.routes[S].show = 0;
          }
        }
        filename = name1 + "_vs_" + name + "_lap" + O + "_time.png";
        if (name != name1) {
          $("#selectgraph-1").val("1");
          mapviewer.plotgraphs();
          z.saveimage(1, filename);
          N.push(filename);
        } else {
        }
      }
    }
    $.ajax({ url: "makeppt.php?out=" + outname + "&image=" + N.join(",") });
    z.printgraph = 0;
    z.settings.showInfoBelow = "";
    z.redraw();
    z.settings.showInfoBelow = "CourseInfo";
  };
