  this.setdpiscale = function (N, R) {
    var M = z.map.width;
    var Y = z.map.height;
    var O = (M / N) * 2.54;
    var Q = (Y / N) * 2.54;
    var U = (O * R) / 100;
    var aa = (Q * R) / 100;
    $("#mapsize").html(
      "<i>Map size: " + parseInt(U) + " x " + parseInt(aa) + " m</i>"
    );
    var S = 60;
    var X = 5;
    var V = 0.01;
    var W = 0.01;
    var ab = calcdistance(S, X, S + V, X);
    var V = (V * U) / ab;
    var ab = calcdistance(S, X, S + V, X);
    var Z = calcdistance(S, X, S, X + W);
    var W = (W * aa) / Z;
    var Z = calcdistance(S, X, S, X + W);
    var T =
      X +
      "|" +
      S +
      "|1|1|" +
      X +
      "|" +
      (S + V) +
      "|" +
      M +
      "|1|" +
      (X + W) +
      "|" +
      S +
      "|1|" +
      Y;
    z.map.initcalibration(T);
    z.map.calstring = T;
    z.redraw();
  };
