      lat1 = this.routes[0].latarray[V];
      lng1 = this.routes[0].lngarray[V];
      lat2 = this.routes[0].latarray[U];
      lng2 = this.routes[0].lngarray[U];
      lat3 = this.routes[0].latarray[T];
      lng3 = this.routes[0].lngarray[T];
