  this.findclosestleg = function (T, N) {
    var ad = null;
    var S = null;
    var Y = 1e99;
    for (var O = 0; O < z.coursecoords.length - 1; O++) {
      var ac;
      var M = z.coursecoords[O];
      var V = z.coursecoords[O + 1];
      var Z = M.split(",");
      var W = parseInt(Z[0]);
      var af = parseInt(Z[1]);
      var X = V.split(",");
      var U = parseInt(X[0]);
      var ae = parseInt(X[1]);
      var ab = (W + U) / 2;
      var aa = (af + ae) / 2;
      var R = z.map.tolatlng(ab, aa);
      ac = new Object();
      ac.x = ab;
      ac.y = aa;
      ac.distance = calcdistance(R.lat, R.lng, T, N);
      ac.P = R;
      ac.index = O;
      var Q = ac.distance;
      if (Q < Y) {
        Y = Q;
        ad = O + 1;
        S = ac;
        S.controlnu = ad;
      }
    }
    return S;
  };
  this.findclosestcalpoint = function (X, R) {
    var Z = null;
    var W = null;
    var Y = 1e99;
    var N = this.map.calstring_points;
    var af = N.split("|");
    var ag = parseFloat(af[2]);
    var Q = parseFloat(af[3]);
    var ae = parseFloat(af[6]);
    var O = parseFloat(af[7]);
    var ac = parseFloat(af[10]);
    var M = parseFloat(af[11]);
    var ah = new Array();
    ah[0] = ag + "," + Q;
    ah[1] = ae + "," + O;
    ah[2] = ac + "," + M;
    for (var S = 0; S < ah.length; S++) {
      var ad;
      var U = ah[S].split(",");
      var ab = U[0];
      var aa = U[1];
      var V = z.map.tolatlng(ab, aa);
      ad = new Object();
      ad.x = ab;
      ad.y = aa;
      ad.distance = calcdistance(V.lat, V.lng, X, R);
      ad.P = V;
      ad.index = S;
      var T = ad.distance;
      if (T < Y) {
        Y = T;
        Z = S;
        W = ad;
        W.calpoint = S;
      }
    }
    return W;
  };
